css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document url-prefix("https://boards.4chan.org/s4s/"), url-prefix("http://boards.4chan.org/s4s/") {

	body { 
		background-image: url('http://i.pomf.pl/tfyxep.png'), url('http://i.pomf.pl/stubtr.png');
		background-position: right,	left;
		background-repeat: repeat-y, repeat-y;  
		padding-top:38px;
		padding-left:54px;
		padding-right:193px;
		padding-bottom:133px;
	}

	body:before{
		background-image: url('http://i.pomf.pl/bpdyrw.png'), url('http://i.pomf.pl/lidmaj.png');
		background-repeat: no-repeat, repeat-x;
		position: fixed;
		bottom: 0;
		left: 0;
		width: 100%;
		height: 123px;
		content: "";
		z-index: 99;
	}
	
	#boardNavDesktop:after{
		background-image: url('http://i.pomf.pl/oayuph.png'), 
		url('http://i.pomf.pl/jttqif.png'), 
		url('http://i.pomf.pl/lgnfhp.png');
		background-position: top right, 
		top left, 
		top;
		background-repeat: no-repeat, 
		no-repeat, 
		repeat-x;
		position: fixed;
		top: 0;
		left: 0;
		width: 100%;
		height: 38px;
		content: "";
		z-index: 99;
	}
	
	body:after{
		background-image: url('http://i.pomf.pl/omiaov.png');
		position: fixed;
		bottom: 0;
		right: 0;
		width: 275px;
		height: 327px;
		content: "";
		z-index: 100;
	}
	
}
